import React, { Component } from 'react';

class Button extends Component {
  constructor(props){
    super(props);
  }

  render() {
    return (
      <button class="mdl-button mdl-js-button mdl-button--raised mdl-button--colored"
        onClick={()=>this.props.callback} >
        {this.props.show}
      </button>
    );
  }
}

export default Button;
